import { useState, useEffect } from "react";

const About = () => {
  const [count, setCount] = useState(5);
  function cch() {
    return count++;
  }
  return (
    <div>
      <p>You clicked {count} times</p>
      <button onClick={() => setCount(cch())}>Click me</button>
    </div>
  );
};

export default About;
